import React from "react";
import Timer from "./Timer";
import OptionInputsText from "./OptionInputsText";
import OptionInputsImage from "./OptionInputsImage";
import OptionInputsTextAndImage from "./OptionInputsTextAndImage";

function EachQuestion({
  setIsAddQuestionsPopupOpen,
  setIsQuizPublishedPopupOpen,
}) {
  const handleCancelBtn = () => {
    setIsAddQuestionsPopupOpen(false);
  };

  const handleCreateQuizBtn = () => {
    setIsQuizPublishedPopupOpen(true);
    setIsAddQuestionsPopupOpen(false);
  };
  const [selectedOptionType, setSelectedOptionType] = useState("Text");
  const renderOptionInputs = () => {
    switch (selectedOptionType) {
      case "Text":
        return <OptionInputsText />;
      case "ImageUrl":
        return <OptionInputsImage />;
      case "TextAndImageUrl":
        return <OptionInputsTextAndImage />;
      default:
        return null;
    }
  };

  return (
    <div>
      <div style={{ height: "8vh", width: "50vw" }}>
        <input
          style={{
            width: "46.5vw",
            marginLeft: "2vw",
            marginTop: "3vh",
            marginRight: "2vw",
            paddingTop: "1.5vh",
            paddingBottom: "1.5vh",
            paddingLeft: "1vw",
            border: "none",
            fontSize: "1.2em",
            borderRadius: "10px",
            boxShadow: "0px 0px 25px 0px #00000026",
          }}
          type="text"
          placeholder="Poll Question "
        ></input>
      </div>

      <div
        style={{
          marginTop: "4.5vh",
          display: "flex",
          justifyContent: "space-between",
          alignItems: "center",
          height: "6vh",
          width: "46vw",
          marginLeft: "2.5vw",
          marginRight: "2.5vw",
          color: "#9F9F9F",
          fontSize: "1.2em",
        }}
      >
        <div style={{ marginRight: "1vw" }}>
          <p>Option Type </p>
        </div>

        <div style={{ marginRight: "1vw" }}>
          <input type="radio" name="optionType" id="Text" />
          <label htmlFor="Text"> Text</label>
        </div>

        <div style={{ marginRight: "1vw" }}>
          <input type="radio" name="optionType" id="ImageUrl" />
          <label htmlFor="ImageUrl"> Image URL</label>
        </div>

        <div>
          <input type="radio" name="optionType" id="TextAndImageUrl" />
          <label htmlFor="TextAndImageUrl"> Text & Image URL</label>
        </div>
      </div>

      <div
        style={{
          height: "38vh",
          width: "48vw",
          display: "flex",
          marginLeft: "1vw",
          marginRight: "1vw",
          justifyContent: "space-between",
          marginTop: "3vh",
          overflow:"auto",
          marginBottom:"4vh"
        }}
      >
        <div style={{ width: "35vw" }}>
        {renderOptionInputs()}
        </div>
        <div style={{ width: "10vw" }}>
          <Timer />
        </div>
      </div>

      <div
        style={{
          height: "6.5vh",
          width: "46vw",
          display: "flex",
          justifyContent: "space-between",
          marginTop: "4vh",
          marginLeft: "2vw",
          marginRight: "2vw",
        }}
      >
        <button
          onClick={handleCancelBtn}
          style={{
            color: "#474444",
            boxShadow: "0px 0px 15px 0px #00000040",
            background: "none",
            fontWeight: "600",
            fontSize: "1.2em",
            width: "17vw",
            borderRadius: "10px",
            paddingTop: "1vh",
            paddingBottom: "1vh",
            border: "none",
            cursor: "pointer",
          }}
        >
          Cancel
        </button>
        <button
          onClick={handleCreateQuizBtn}
          style={{
            color: "#FFFFFF",
            backgroundColor: "#60B84B",
            fontWeight: "600",
            fontSize: "1.2em",
            width: "17vw",
            borderRadius: "10px",
            paddingTop: "1vh",
            paddingBottom: "1vh",
            border: "none",
            cursor: "pointer",
          }}
        >
          Create Quiz
        </button>
      </div>
    </div>
  );
}

export default EachQuestion;
